#pragma once
#include <vector>
#include <string>
#include <fstream>
#include <sstream>
#include <iostream>
#include <algorithm>

inline std::vector<std::string> split(const std::string &s, char delim) {
    std::vector<std::string> out; std::stringstream ss(s); std::string item;
    while (std::getline(ss, item, delim)) out.push_back(item);
    return out;
}

// Very small CSV loader: returns header and rows (each row vector<string>)
inline bool load_csv(const std::string &path, std::vector<std::string> &header, std::vector<std::vector<std::string>> &rows) {
    std::ifstream in(path);
    if (!in) return false;
    std::string line;
    if (!std::getline(in, line)) return false;
    header = split(line, ',');
    while (std::getline(in, line)) {
        if(line.size()==0) continue;
        auto cols = split(line, ',');
        // trim spaces
        for (auto &c : cols) {
            c.erase(0, c.find_first_not_of( \t\r\n));
            c.erase(c.find_last_not_of( \t\r\n) + 1);
        }
        if (cols.size() != header.size()) {
            // allow missing trailing cols by padding
            cols.resize(header.size(), );
        }
        rows.push_back(cols);
    }
    return true;
}
