#pragma once
#include <Eigen/Dense>
#include <vector>
#include <string>
#include <iostream>
#include <fstream>
#include <cmath>

// Simple scaler (mean/std on columns)
struct StandardScaler {
    Eigen::VectorXd mean, std;
    void fit(const Eigen::MatrixXd &X) {
        mean = X.colwise().mean();
        std.resize(X.cols());
        Eigen::MatrixXd Xc = X.rowwise() - mean.transpose();
        for (int j=0;j<X.cols();++j) {
            double var = (Xc.col(j).array().square().sum()) / (X.rows());
            std(j) = std::sqrt(var);
            if (std(j) == 0) std(j) = 1.0;
        }
    }
    Eigen::MatrixXd transform(const Eigen::MatrixXd &X) const {
        Eigen::MatrixXd Y = X.rowwise() - mean.transpose();
        for (int j=0;j<X.cols();++j) Y.col(j) /= std(j);
        return Y;
    }
    Eigen::MatrixXd inverse_transform(const Eigen::MatrixXd &X) const {
        Eigen::MatrixXd Y = X;
        for (int j=0;j<X.cols();++j) Y.col(j) *= std(j);
        Y = Y.rowwise() + mean.transpose();
        return Y;
    }
};

// Metrics
inline double rmse(const Eigen::VectorXd &y_true, const Eigen::VectorXd &y_pred) {
    return std::sqrt(((y_true - y_pred).array().square().mean()));
}
inline double mae(const Eigen::VectorXd &y_true, const Eigen::VectorXd &y_pred) {
    return (y_true - y_pred).array().abs().mean();
}

// Save and load vector to simple text file
inline void save_vector(const std::string &path, const Eigen::VectorXd &v) {
    std::ofstream out(path);
    for (int i=0;i<v.size();++i) out << v(i) << \n;
}
inline Eigen::VectorXd load_vector(const std::string &path) {
    std::ifstream in(path);
    std::vector<double> vals;
    double x;
    while (in >> x) vals.push_back(x);
    Eigen::VectorXd v(vals.size());
    for (size_t i=0;i<vals.size();++i) v(i)=vals[i];
    return v;
}
