### linear_model.hpp
```cpp
#pragma once
#include <Eigen/Dense>
#include <string>
#include <fstream>
#include <iostream>

// Linear regression with optional L2 (ridge) regularization
struct LinearRegression {
    Eigen::VectorXd coef; // includes intercept as last element
    bool fitted = false;

    void fit_normal(const Eigen::MatrixXd &X, const Eigen::VectorXd &y, double l2=0.0) {
        // X: (n_samples, n_features)
        int n = X.rows(), p = X.cols();
        Eigen::MatrixXd A(n, p+1);
        A << X, Eigen::VectorXd::Ones(n);
        Eigen::MatrixXd ATA = A.transpose() * A;
        if (l2 > 0) {
            ATA += l2 * Eigen::MatrixXd::Identity(ATA.rows(), ATA.cols());
            // do not regularize intercept: set last diagonal to original
            ATA(ATA.rows()-1, ATA.cols()-1) -= l2;
        }
        Eigen::VectorXd ATy = A.transpose() * y;
        coef = ATA.ldlt().solve(ATy);
        fitted = true;
    }

    Eigen::VectorXd predict(const Eigen::MatrixXd &X) const {
        if (!fitted) throw std::runtime_error(Model not fitted);
        Eigen::MatrixXd A(X.rows(), X.cols()+1);
        A << X, Eigen::VectorXd::Ones(X.rows());
        return A * coef;
    }

    void save(const std::string &path) const {
        std::ofstream out(path);
        out << coef.size() << \n;
        for (int i=0;i<coef.size();++i) out << coef(i) << \n;
    }
    void load(const std::string &path) {
        coef = load_vector(path);
        fitted = true;
    }
};
