### nn_model.hpp
```cpp
#pragma once
#include <Eigen/Dense>
#include <random>
#include <iostream>
#include <cmath>
#include util.hpp

// Small feed-forward network: input -> hidden (ReLU) -> output (linear)
// Trained with simple SGD (batch size configurable)
struct SimpleNN {
    int in_dim=0, hidden=0;
    Eigen::MatrixXd W1; // (in_dim, hidden)
    Eigen::VectorXd b1; // (hidden)
    Eigen::VectorXd W2; // (hidden) -> output scalar
    double b2 = 0.0;
    bool initialized=false;

    SimpleNN(int in_dim_=0, int hidden_=16) : in_dim(in_dim_), hidden(hidden_) {
        if (in_dim_>0) init(in_dim_, hidden_);
    }

    void init(int in_dim_, int hidden_) {
        in_dim=in_dim_; hidden=hidden_;
        std::mt19937 rng(1234);
        std::normal_distribution<double> nd(0.0, 1.0/std::sqrt(in_dim));
        W1 = Eigen::MatrixXd(in_dim, hidden);
        for (int i=0;i<in_dim;i++) for (int j=0;j<hidden;j++) W1(i,j) = nd(rng);
        b1 = Eigen::VectorXd::Zero(hidden);
        W2 = Eigen::VectorXd(hidden);
        for (int j=0;j<hidden;j++) W2(j) = nd(rng);
        b2 = 0.0;
        initialized=true;
    }

    // forward: X (n, in_dim) -> y_pred (n)
    Eigen::VectorXd forward(const Eigen::MatrixXd &X, Eigen::MatrixXd *hidden_out=nullptr) const {
        Eigen::MatrixXd Z = (X * W1).rowwise() + b1.transpose(); // (n, hidden)
        // ReLU
        for (int i=0;i<Z.rows();++i) for (int j=0;j<Z.cols();++j) if (Z(i,j) < 0) Z(i,j)=0;
        if (hidden_out) *hidden_out = Z;
        Eigen::VectorXd out = Z * W2 + Eigen::VectorXd::Ones(Z.rows()) * b2;
        return out;
    }

    // Train with SGD (mean squared error)
    void fit_sgd(const Eigen::MatrixXd &X, const Eigen::VectorXd &y,
                 int epochs=200, double lr=1e-3, int batch_size=32, double weight_decay=0.0) {
        if (!initialized) init(X.cols(), hidden==0 ? 16 : hidden);
        int n = X.rows();
        std::vector<int> idx(n);
        for (int i=0;i<n;++i) idx[i]=i;
        std::mt19937 rng(42);
        for (int ep=0; ep<epochs; ++ep) {
            std::shuffle(idx.begin(), idx.end(), rng);
            for (int start=0; start<n; start+=batch_size) {
                int end = std::min(n, start+batch_size);
                int bs = end - start;
                Eigen::MatrixXd XB(bs, X.cols());
                Eigen::VectorXd yb(bs);
                for (int i=0;i<bs;++i) {
                    XB.row(i) = X.row(idx[start+i]);
                    yb(i) = y(idx[start+i]);
                }
                // forward
                Eigen::MatrixXd Z;
                Eigen::VectorXd ypred = forward(XB, &Z); // (bs)
                Eigen::VectorXd err = ypred - yb; // (bs)
                double scale = 2.0 / bs; // derivative factor for mse

                // gradients for W2 and b2
                Eigen::VectorXd dW2 = Z.transpose() * err * (1.0); // (hidden)
                double db2 = err.sum();

                // backprop to hidden: (bs, hidden)
                Eigen::MatrixXd dZ = err.replicate(1, Z.cols()).array() * Z.unaryExpr([](double v){ return v>0 ? 1.0 : 0.0; }).array();
                // dW1: X^T * dZ
                Eigen::MatrixXd dW1 = XB.transpose() * dZ;
                Eigen::VectorXd db1 = dZ.colwise().sum();

                // apply weight decay
                if (weight_decay > 0.0) {
                    dW2 += weight_decay * W2;
                    dW1 += weight_decay * W1;
                }

                // gradient step
                W2 -= (lr * dW2) / bs;
                b2 -= (lr * db2) / bs;
                W1 -= (lr * dW1) / bs;
                b1 -= (lr * db1) / bs;
            }
            // optional: print loss every 50 epochs
            if ((ep+1) % 50 == 0) {
                Eigen::VectorXd yp = forward(X);
                double loss = ((yp - y).array().square().mean());
                std::cerr << Epoch  << (ep+1) <<  loss= << loss << \n;
            }
        }
    }

    Eigen::VectorXd predict(const Eigen::MatrixXd &X) const {
        return forward(X);
    }

    void save(const std::string &prefix) const {
        save_vector(prefix + _W1.txt, Eigen::Map<const Eigen::VectorXd>(W1.data(), W1.size()));
        save_vector(prefix + _b1.txt, b1);
        save_vector(prefix + _W2.txt, W2);
        std::ofstream out(prefix + _b2.txt); out << b2 << \n;
        // small metadata
        std::ofstream meta(prefix + _meta.txt); meta << in_dim <<   << hidden << \n;
    }
    void load(const std::string &prefix) {
        Eigen::VectorXd W1v = load_vector(prefix + _W1.txt);
        b1 = load_vector(prefix + _b1.txt);
        W2 = load_vector(prefix + _W2.txt);
        std::ifstream in(prefix + _b2.txt); in >> b2;
        std::ifstream meta(prefix + _meta.txt);
        meta >> in_dim >> hidden;
        W1 = Eigen::Map<Eigen::MatrixXd>(W1v.data(), in_dim, hidden);
        initialized = true;
    }
};
