### main.cpp
```cpp
#include <iostream>
#include <algorithm>
#include csv_reader.hpp
#include util.hpp
#include linear_model.hpp
#include nn_model.hpp
#include <chrono>

int main(int argc, char** argv) {
    if (argc < 2) {
        std::cout << Usage: ./uk_weather_cpp data.csv\n;
        return 1;
    }
    std::string path = argv[1];
    std::vector<std::string> header;
    std::vector<std::vector<std::string>> rows;
    if (!load_csv(path, header, rows)) {
        std::cerr << Failed to read CSV:  << path << \n;
        return 2;
    }

    // find columns
    int idx_date=-1, idx_target=-1;
    std::vector<int> feat_idx;
    for (size_t i=0;i<header.size();++i) {
        std::string h = header[i];
        if (h==date) idx_date = i;
        if (h==target) idx_target = i;
    }
    if (idx_target<0) {
        std::cerr << CSV must contain 'target' column\n;
        return 3;
    }
    for (size_t i=0;i<header.size();++i) if ((int)i!=idx_date && (int)i!=idx_target) feat_idx.push_back(i);

    int n = rows.size();
    int p = feat_idx.size();
    Eigen::MatrixXd X(n, p);
    Eigen::VectorXd y(n);
    for (int i=0;i<n;++i) {
        // parse features
        for (int j=0;j<p;++j) {
            std::string s = rows[i][feat_idx[j]];
            double v = 0.0;
            if (s.size()>0) v = std::stod(s);
            X(i,j) = v;
        }
        // target
        std::string st = rows[i][idx_target];
        y(i) = st.size()>0 ? std::stod(st) : 0.0;
    }

    // TIME-SERIES split: first 80% train, last 20% test
    int n_train = static_cast<int>(std::floor(n * 0.8));
    int n_test = n - n_train;
    Eigen::MatrixXd X_train = X.topRows(n_train);
    Eigen::MatrixXd X_test = X.bottomRows(n_test);
    Eigen::VectorXd y_train = y.head(n_train);
    Eigen::VectorXd y_test = y.tail(n_test);

    // scale features
    StandardScaler scaler;
    scaler.fit(X_train);
    Eigen::MatrixXd Xtr_s = scaler.transform(X_train);
    Eigen::MatrixXd Xte_s = scaler.transform(X_test);

    // 1) Linear regression
    LinearRegression lr;
    lr.fit_normal(Xtr_s, y_train, 0.1); // l2=0.1
    Eigen::VectorXd pred_lr = lr.predict(Xte_s);
    std::cout << Linear Regression RMSE:  << rmse(y_test, pred_lr) <<  MAE:  << mae(y_test, pred_lr) << \n;
    lr.save(linear_model.txt);

    // 2) Simple NN
    SimpleNN nn(Xtr_s.cols(), std::min(64, (int)Xtr_s.cols()*4));
    auto t0 = std::chrono::high_resolution_clock::now();
    nn.fit_sgd(Xtr_s, y_train, 400, 1e-3, 32, 1e-4);
    auto t1 = std::chrono::high_resolution_clock::now();
    std::chrono::duration<double> dt = t1 - t0;
    std::cout << NN training time:  << dt.count() << s\n;
    Eigen::VectorXd pred_nn = nn.predict(Xte_s);
    std::cout << NN RMSE:  << rmse(y_test, pred_nn) <<  MAE:  << mae(y_test, pred_nn) << \n;
    nn.save(nn_model);

    // example: print first 10 predictions
    std::cout << \nFirst 10: true , lr_pred , nn_pred\n;
    for (int i=0;i<std::min(10, (int)y_test.size()); ++i) {
        std::cout << y_test(i) <<  ,  << pred_lr(i) <<  ,  << pred_nn(i) << \n;
    }

    return 0;
}
