# How to compile & run

1. Install dependencies:
   - Eigen3 (Ubuntu/Debian: `sudo apt install libeigen3-dev`) or get Eigen from https://eigen.tuxfamily.org (header-only).  
   - A C++17 compiler and CMake.

2. Build:
```bash
mkdir build
cd build
cmake ..
make -j
```

3. Prepare data: `data.csv` (header includes `date,target,feat1,feat2,...`). Example first lines:
```
date,target,lag1_temp,lag2_temp,roll3_mean,precip_sum,mslp,day_sin,day_cos
2000-01-01,7.3,6.5,6.8,6.9,0.0,1012.3,0.0,1.0
2000-01-02,8.1,7.3,6.5,6.9,5.2,1011.1,0.17,0.98
...
```

4. Run:
```bash
./uk_weather_cpp ../data.csv
```

Youll get evaluation metrics printed and model files saved.

