# Notes, improvements & next steps

- **Feature engineering:** The model quality depends heavily on features: use lagged temps (17 days), rolling mean/std, day-of-year sine/cos, recent precipitation sums, pressure trend (differences), wind components, dewpoint-derived humidity, and large-scale predictors (NAO index, etc.). You can precompute those in Python (or C++) and feed the CSV to this program.
- **Better models:** For competitive accuracy use XGBoost/LightGBM or a sequence model (LSTM, Temporal ConvNet). They have C++ APIs or you can train in Python and export (ONNX). If you want, Ill give a C++ wrapper for XGBoost or show how to call LightGBM.
- **Uncertainty & ensembles:** Consider ensembling linear/NN/GBM and producing prediction intervals (quantile regression or ensemble spread).
- **Spatial models:** For multiple stations or gridded predictions, reshape data into a grid and consider convolutional/graph methods  we can extend the C++ code to load grids/netCDF (use netCDF C++ libs) and train multi-output models.
- **Deployment:** The saved models are simple text files  for production, replace with binary serialization or integrate with model-serving (REST) code.

